import React from "react";
import Response from "./Response";

export default function RespostaSimulacao( props ) {
    const { combinations } = props
    console.log(combinations)

  return (
    <div className="RespostaSimulacao">
      <div className="RespostaSimulacaoHeader">
        <img className="moneyIcon" src="https://static.vecteezy.com/system/resources/previews/011/660/689/original/3d-money-icon-illustration-png.png" alt="Ícone de dinheiro"></img>
        <h1 className="SimulacoesTitle">SIMULAÇÕES</h1>
        <img className="moneyIcon" src="https://static.vecteezy.com/system/resources/previews/011/660/689/original/3d-money-icon-illustration-png.png" alt="Ícone de dinheiro"></img>
      </div>

      {combinations.map((combination, index) => (
                <Response key={index}>
                    <p>Nome: {combination.nome}</p>
                    <p>Volume Total: {combination.volume_t}</p>
                    <p>Peso Total: {combination.peso_t}</p>
                    <p>Custo Unitário: {combination.custo_uni}</p>
                    <p>Venda Unitária: {combination.venda_uni}</p>
                    <p>Lucro Unitário: {combination.lucro_uni}</p>
                    <p>Lucro Total: {combination.lucro_t}</p>
                    <p>Quantidade: {combination.qtde}</p>
                </Response>
        ))}
    </div>
  );
}
